import React from 'react';
import './splash.css';

function Splash() {
    return (
        <div>
            <div className="splash">
                <div className="splash-top">
                    <div className="splash-top1">
                        I am a full-stack 
                    </div>
                    <div className="splash-top2">
                        software developer
                    </div>
                </div>
                <div className="splash-bottom">
                    Based in San Jose, CA
                </div>
            </div>
        </div>
    )
}

export default Splash;
